function clojureFindDefinition(thenDo) {
  var ed             = this.aceEditor,
      editorMorph    = this,
      browser        = this.clojureGetMyBrowser(),
      clojure        = Global.clojure,
      selectedNs     = browser.get("nsList").selection,
      selectedIntern = browser.get("nsInternList").selection;

  lively.lang.fun.composeAsync(

    // 1. get static information for the node at point
    function(n) {
      browser.historyRecordNavigation();

      var query = clojure.StaticAnalyzer.createDefinitionQuery(
        ed.session.$ast||ed.getValue(), ed.getCursorIndex(),
        editorMorph.clojureGetNs ? editorMorph.clojureGetNs() : null);
      if (!query) n("Cannot extract code entity.");
      else if (query.source.match(/^:/)) n("It's a keyword, no definition for it.");
      else n(null, query);
    },


    // 2. get the associated intern data and source of the ns the i is defined in
    function(query, n) {
      var file = browser && browser.namespaceData && browser.namespaceData[query.nsName].file;
      var opts = {
        env: clojure.Runtime.currentEnv(editorMorph),
        ns: query.nsName,
        addNsSource: !browser,
        file: file
      }

      clojure.Runtime.retrieveDefinition(
        query.source, query.nsName, opts,
        function(err, data) { n(err, query, data); });
    },

    // ensure that the browser has the target's ns loaded
    function(query, data,n) {
      if (data.intern.ns in browser.namespaceData) return n(null,query,data);
      browser.cljFindUnlistedNamespaces(function(err) { n(err, query, data); });
    },

    // select the target
    function(query,data,n) {
      var nsName = data.intern.ns, targetName = data.intern.name;
      var nsData = browser.namespaceData[nsName];
      if (!nsData) {
        // ns could not be found loaded in this browser, show source in
        // workspace
        var editor = clojure.UI.showSource({
          title: data.intern.ns + "/" + data.intern.name,
          content: data.nsSource
        });
        data.defRange && scrollToAndSelect(
          editor, null, data.defRange, data.intern && data.intern.name);
        return n();
      }

      if (selectedNs === nsName) {
        if (!selectedIntern) {
          data.defRange && scrollToAndSelect(
            editorMorph, browser, data.defRange, data.intern && data.intern.name);
          n();
        } else {
          browser.saveScheduleSelection(nsName, null, true, function(err) {
            data.defRange && scrollToAndSelect(
              editorMorph, browser, data.defRange, data.intern && data.intern.name);
            n(err);
          });
        }
      } else browser.scheduleSelection(nsName, null, true, function(err) {
        if (err) return n(err);
        data.defRange && scrollToAndSelect(
          editorMorph, null, data.defRange, data.intern && data.intern.name);
        n();
      });
    }
  )(function(err) {
    if (err)
      editorMorph.setStatusMessage("Error retrieving definition:\n" + err);
    thenDo && thenDo(err);
  });

  function scrollToAndSelect(editMorph, browser, defRange, name) {
    return editMorph.withAceDo(function(ed) {
      var range = {start: ed.idxToPos(defRange[0]), end: ed.idxToPos(defRange[1])};
      var found = ed.$morph.saveExcursion(function(reset) {
        ed.selection.setRange(range, true);
        if (!name) return true;
        // test if it looks like we found definition
        var found = !!ed.session.getTextRange(range).match(new RegExp("def[^/]+"+name, "m"));
        if (!found) reset();
        return found;
      });
      if (found) setTimeout(function() {
        browser && browser.historyRecordNavigation();
        ed.centerSelection();
      }, 100);
      return found;
    });
  }
}

