function doAction() {
  var browser = this.get("ClojureBrowser"),
      sel = browser.get("nsList").selection,
      items = [
        ['add namespace... (Alt-n)', function() { browser.createNamespaceInteractively() }],
        {isMenuItem: true, isDivider: true},
        ['load project... (Alt-l)', function() { browser.loadProjectInteractively(); }],
        {isMenuItem: true, isDivider: true},
        ['discover new namespaces', function() { browser.reload({}); }],
        ['reload all namespaces', function() { browser.reload({refreshClasspathDirs: false, all: true, reselect: true}); }]
        // ['tools.namespace.repl/refresh-all', function() { browser.cljRefreshClassPathDirs(); }]
      ].concat(sel ? [
        ["reload " + sel, function() {
           delete browser.namespaceData[sel];
           browser.reload({namespaces: [sel], reselect: true});
        }],
        ["set new file for " + sel, function() {
          // browser.namespaceData[sel].file
          lively.ide.CommandLineSearch.interactivelyChooseFileSystemItem(
            "new file for " + sel + ": ", lively.shell.cwd(),
            function(files) {
              return files.filter(function(file) {
                var path = typeof file === "string" ? file : file.path;
                return file.isDirectory || path.match(/\.clj.?$/);
              }).sortByKey("isDirectory");
            },
            "clojure.browser.ClojureScript.relocateNS",
            [function choose(candidate) {
              var path = candidate.path;
              if (candidate.isDirectory) {
                $world.inform("Cannot accept a directory (" + path + ")");
              } else {
                browser.namespaceData[sel].file = path;
                browser.namespaceData[sel].interns = null;
                browser.namespaceData[sel].source = null;
                browser.reload({namespaces: [sel], reselect: true});
              }
            }]);
        }]
      ] : []);
  lively.morphic.Menu.openAtHand(null, items);
}

