            case 'Down':
            case 'Alt-Ã¥': // "Alt-N"
            case 'Control-Down': this.showNextCommand(); this.focus(); evt.stop(); return true;
            case 'Alt-H': this.browseHistory(); evt.stop(); return true;
            case 'Esc':
            case 'Control-G': this.clear(); evt.stop(); return true;
            default: return $super(evt);        
        }
    }

