614.source:
function updateNsInternList(thenDo) {
  var nsList = this.get("nsList");
  var list = this.get("nsInternList");
  var sel = nsList.getSelection();
  var showPrivateVars = this.get("privateCheckBox").checked;
  if (!sel) {
    list.setList([]);return;
  }
  var d = this.namespaceData[sel];
  var interns = d && d.interns ? d.interns : [];

  var items = interns.map(function (ea) {
    if (ea["private"] && !showPrivateVars) return null;
    if (ea.protocol && interns.some(function (other) {
      return other.name === ea.protocol.name;
    })) return null;
    return {
      isListItem: true,
      string: ea.name + (ea["private"] ? " (private)" : ""),
      value: ea
    };
  }).compact();
  if (typeof thenDo === "function") lively.bindings.once(list, "rendered", function () {
    thenDo();
  }, "call");
  list.setList(items);
}

