function reset() {
  this.doNotSerialize = ["_scheduleSelectionQueue", "_selectionUpdateInProgress"];

  lively.bindings.connect(this.get("nsList"), "selection", this, "saveScheduleSelection", {
    updater: function updater($upd, val) {
      $upd(val, null);
    } });
  lively.bindings.connect(this.get("nsInternList"), "selection", this, "saveScheduleSelection", {
    updater: function updater($upd, val) {
      $upd(this.targetObj.get("nsList").selection, val);
    } });

  lively.bindings.connect(this.get("privateCheckBox"), "checked", this, "togglePrivateVars");
  // lively.bindings.connect(this.get("searchSymbolButton"), 'fire', this, 'narrowNamespaceData');
  lively.bindings.connect(this.get("backButton"), "fire", this, "historyBack");
  lively.bindings.connect(this.get("forwardButton"), "fire", this, "historyForward");
