function cljFetchNamespaceData(namespaceList, thenDo) {
  var self = this;
  if (!namespaceList.length) return thenDo && thenDo(null, self.namespaceData);
  var pbar = $world.addStatusProgress("reading clj namespaces...");
  lively.lang.arr.mapAsyncSeries(namespaceList, function (ns, i, next) {
