      self.namespaceData = results.reduce(function (nsMap, ea) {
        if (ea[2]) {
          // err
          nsMap[ea[0]] = { name: ea[0], file: null, interns: [], source: String(ea[2]) };
        } else if (ea[1]) {
          nsMap[ea[0]] = {
            name: ea[0], file: ea[1].file, interns: ea[1].interns, source: ea[1].source || ""
          };
        } else delete nsMap[ea[0]];
        return nsMap;
      }, self.namespaceData || {});
    }
    thenDo && thenDo(err, self.namespaceData);
  });
}

