function scheduleSelection(nsName, nsInternOrName, force, thenDo) {
  if (typeof force === "function") {
    // force == select even if current selection alread matches
    thenDo = force;force = false;
  }

  // init state
  var debug = false;
  var self = this;
  var nsList = self.get("nsList"),
      internList = self.get("nsInternList");

  self._scheduleSelectionQueue = self._scheduleSelectionQueue || (self._scheduleSelectionQueue = []);

  var nsIntern = nsInternOrName && nsInternOrName.name ? nsInternOrName.name : nsInternOrName;
  if (!force && self.isSelected(nsName, nsIntern)) return typeof thenDo === "function" && thenDo();

  self._scheduleSelectionQueue.push([nsName, nsIntern, thenDo]);
  debug && show("scheduleSelection: %s %o", nsName, nsIntern);

  // if we are currently selecting, don't interfere
  if (self._selectionUpdateInProgress) return;

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

  // we gather selection requests, those are reduced into a single actual
  // selection action

  // self._selectionUpdateInProgress=false
  self._selectionUpdateInProgress = true;

  if (this.currentHistoryNavItem && this.recordNavigation) {
    this.currentHistoryNavItem.selection = this.get("CodeEditor").getSelectionRange()
    // show("recording %s %s", this.currentHistoryNavItem.selection[0], this.currentHistoryNavItem.selection[1]);

    ;
  }

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
  // and now the work begins...

  lively.lang.fun.debounceNamed(self.id + "-scheduleSelection", 100, function () {
    var endActions = lively.lang.fun.either(function timeout() {
      step6_RunCallbacksAndCleanup(new Error("timeout!"));
    }, function normalend(err, selSpec) {
      step6_RunCallbacksAndCleanup(err, selSpec);
    });

    lively.lang.fun.composeAsync(step1_retrieveSelectionSpec, step1_updateTitle, step2a_fetchNSData, step2_nsListSelection, step3_initUpdateNsInternList, step4_initUpdateSourceView, step5_recordNavigation)(endActions[1]);

    Global.setTimeout(endActions[0], 5000);
  })();

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
  // tasks below
  // -=-=-=-=-=-=-=-

  function step1_retrieveSelectionSpec(next) {
    var last = self._scheduleSelectionQueue.last();
    self._scheduleSelectionQueue = self._scheduleSelectionQueue.slice(-1);

    var selSpec = { nsName: last ? last[0] : null, nsIntern: last ? last[1] : null };
    debug && show(selSpec);
    next(null, selSpec);
  }

  function step1_updateTitle(selSpec, next) {
