function saveNsOrIntern(nsName, nsInternName, source, thenDo, noWarning) {
  var self = this,
      isInternSave = !!nsInternName,
      writeToFile = this.get("SaveToFileCheckBox").isChecked() && this.get("SaveToFileCheckBox").get(/checkbox/i).isActive(),
      editor = this.get("CodeEditor"),
      ns = editor.clojureGetNs() || nsName,
      env = Global.clojure.Runtime.currentEnv(editor),
      nsData = this.namespaceData[nsName],
      intern = isInternSave ? (nsData.interns || []).detect(function (ea) {
    return ea.name === nsInternName;
  }) : null,
      code = lively.lang.string.format("(rksm.system-navigator.system-browser/change-%s! '%s rksm.cloxp-repl/*repl-source* %s %s)", isInternSave ? "def" : "ns", isInternSave ? ns + "/" + nsInternName : ns, writeToFile, nsData.file ? "\"" + nsData.file + "\"" : ""),
      warnings,
      opts = {
    env: env, ns: isInternSave ? ns : "user", passError: true,
    warningsAsErrors: false, onWarning: function onWarning(warn) {
      warnings = warn;
    },
    requiredNamespaces: ["rksm.system-navigator.system-browser"],
    bindings: ["rksm.cloxp-repl/*repl-source*", source]
  };

  if (!noWarning && warnAboutFileSave()) return;
  if (!noWarning && warnAboutSuspiciousData()) return;

  Global.clojure.Runtime.doEval(code, opts, function (err, evalResult) {

    lively.lang.fun.composeAsync(updateSelf, updateOthers)(function (err2) {
      var refErrMatcher = /java.lang.IllegalStateException: ([^\s\n]+) already refers to: (#'[^\s\n]+) in namespace: ([^\s\n,]+)/;
      var referErrorMatch = err && String(err).match(refErrMatcher) || warnings && warnings.match(refErrMatcher);

      if (referErrorMatch) handleReferError(err || warnings, referErrorMatch[1], referErrorMatch[2], referErrorMatch[3], thenDo);else if (err) self.showClojureError(err, "Error saving " + nsName);else if (err2) editor.setStatusMessage("Error updating editors: " + err2, Global.Color.red);else {
        editor.setStatusMessage([["Successfully saved " + nsName, { color: Global.Color.green }], warnings ? ["\nshow\n", { color: Global.Color.orange, textAlign: "right", fontSize: 9,
          doit: { context: { ed: editor.aceEditor, content: warnings },
            code: "this.ed.execCommand(\"clojureOpenEvalResult\", {insert: false, content: this.content});" } }] : [""], [warnings ? warnings.truncate(500) : "", { color: Global.Color.orange }]], Global.Color.black);
        editor._statusMorph.insertion = warnings;
      }
      thenDo && thenDo(err || err2);
    });
  });

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

  function updateSelf(n) {
    editor.markClean();

    // self.reload({namespaces: [ns]}, n);

    lively.lang.fun.composeAsync(self.cljFetchNamespaceData.bind(self, [ns]), function (nsData, n) {
      if (nsData && nsData[ns]) {
        if (!isInternSave) nsData[ns].source = source;
        self.namespaceData[ns] = nsData[ns];
      }
      n(null, nsData);
    }, function (nsData, n) {
      if (!isInternSave) {
        self.updateNsInternList(n);
      } else {
        self.get("nsInternList").getList().zip(self.namespaceData[ns].interns).forEach(function (itemAndIntern) {
          itemAndIntern[0].value = itemAndIntern[1];
        });
        n();
      }
    })(n);
  }

  function updateOthers(n) {
    // show("%o",self.namespaceData[ns].interns)
    self.informOtherClojureBrowsersAboutChange(nsName, isInternSave ? nsInternName : null, n);
  }

  function warnAboutFileSave() {
    if (writeToFile) return false;
    var msg = (nsData.file ? nsData.file : nsName) + " cannot be written!\nYou can still evaluate code / change the runtime objects but your save will not persist!\nAdd a new namespace to make your changes persistent.\nDo you want to continue to save and only change the runtime objects?";
    $world.confirm(msg, function (input) {
      if (!input) return editor.setStatusMessage("Save canceled");
      self.saveNsOrIntern(nsName, nsInternName, source, thenDo, true);
    });
    return true;
  }

  function warnAboutSuspiciousData() {
    if (!isInternSave) return false;
    var msg;
    if (!intern) msg = "No intern data for " + nsInternName;else if (!intern.line) msg = "No namespace position info for " + nsInternName;else if (intern.line == 1) msg = nsInternName + " will be mapped into the namespace " + nsName + " onto line 1.\nThis would overwrite a ns declaration and could lead to problems.\n(Reason for this might be that you evaluated " + nsInternName + " outside of the browser)";
    if (!msg) return false;
    $world.confirm(msg, function (input) {
      if (input) return self.saveNsOrIntern(nsName, nsInternName, source, thenDo, true);
      editor.setStatusMessage("Save canceled.");
    }, "Do you want to save anyway?");
    return true;
  }

  function handleReferError(err, name, alreadRefersToVar, inNamespace, thenDo) {
    Global.clojure.Runtime.doEval(lively.lang.string.format("(ns-unmap *ns* '%s)", name), { env: env, ns: inNamespace, passError: true }, function (err, result) {});

    var msg = [["To resolve this issue add :require [" + alreadRefersToVar.match(/#'([^\/]+)/)[1] + " ... :exclude (" + name + ")]\nto your requirements!\n", { fontWeight: "bold" }],
    // {doit: {context: {
    //   name: name, ns: ns, nsName: nsName, env: env,
    //   nsInternName: nsInternName, source: source,
    //   noWarning: noWarning, editor: editor, browser: self
    // }, code: lively.lang.fun.extractBody(unrefer)}}],
    [("Name conflict:\n" + err).truncate(500)]];
    editor.setStatusMessage(msg, Global.Color.red);
  }

  // function unrefer() {
  //   var name = this.name, ns = this.ns, nsName = this.nsName, env = this.env,
  //       nsInternName = this.nsInternName, source = this.source,
  //       noWarning = this.noWarning, editor = this.editor, browser = this.browser;
  //   editor.hideStatusMessage()
  //   clojure.Runtime.doEval(
  //     lively.lang.string.format("(ns-unmap *ns* '%s)", name),
  //     {env: env, ns: this.ns, passError: true},
  //     function(err, result) {
  //       show(err||result)
  //       if (err) editor.showClojureError(err, "Error un-mapping " + name);
  //       else browser.saveNsOrIntern(nsName, nsInternName, source, null, noWarning);
  //     });
  // }
