      askToLoadNamespaces: true,
      setCurrentDir: true,
      informBrowsers: true
    }), select
  )(function (err, loadResult) {
    indicatorClose && indicatorClose();
    (function () {
      if (err) self.showClojureError(err, "Error loading project" + (loadResult && loadResult.dir ? " " + loadResult.dir : ""));else e.setStatusMessage(report || "Successfully loaded project " + loadResult.dir);
    }).delay(0.2);
  });

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

  function deselect(n) {
    self.saveScheduleSelection(null, null, true, n);
  }

  function select(loadResult, n) {
    if (!loadResult.cljNamespaces.length) return n(null, loadResult);
    (function () {
      var ns = loadResult.cljNamespaces[0];
      if (ns && ns.ns) ns = ns.ns;
      self.scheduleSelection(ns, null, true);
      n(null, loadResult);
    }).delay(0.2);
  }
}

