function setEditorListPanelRatio(ratio) {
  // var ratio = 1/3;
  var ext = this.getExtent();
  var targetY = ext.scaleBy(0, ratio).y;
  var nowY = this.get("midResizer").bounds().center().y;
  var delta = targetY - nowY;
  this.get("midResizer").movedVerticallyBy(Math.round(delta));
}

