function cljRemoveNs(nsName, thenDo) {
  var self = this;
  var nsData = self.namespaceData[nsName];

  lively.lang.fun.composeAsync(function (n) {
    delete self.namespaceData[nsName];n();
  }, function (n) {
    self.doCljEval(Strings.format("(remove-ns '%s)", nsName), { passError: true }, function (err, result) {
      n(err);
    });
  }, function (n) {
    if (!nsData.file) return n();
    $world.confirm("Also delete file " + nsData.file + "?", function (input) {
      if (!input) return n();
      self.doCljEval(lively.lang.string.format("(-> (clojure.java.io/file \"%s\") .delete)", nsData.file), { passError: true }, function (err) {
        n(err);
      });
    });
  }, self.scheduleSelection.bind(self, null, null), self.updateNsList.bind(self, self.namespaceData), self.informOtherClojureBrowsersAboutChange.bind(self, nsName, null))(function (err) {
    if (err) {
      self.get("CodeEditor").setStatusMessage("Error removing " + nsName + "\n" + String(err).truncate(500));
    }
  });
}

